import React from 'react';

const Header = (): JSX.Element => (
    <header
        style={{
            background: `#6c757d`,
            marginBottom: `1.45rem`,
        }}
    >
        <div
            style={{
                margin: `0 auto`,
                maxWidth: 960,
                padding: `1.45rem 1.0875rem`,
            }}
        >
            <h1 style={{ margin: 0, color: `white` }}>Test Store </h1>
            <h2 style={{ margin: 0, color: `white`, float: `right` }}>Cart </h2>
        </div>
    </header>
);

export default Header;
